import React from 'react';
import {Component} from 'react';
import Pictures from "./Pictures"
import './App.css';
import { entries } from './EntriesData.js'
import { Navbar, NavDropdown, Nav, Form, FormControl, Button } from 'react-bootstrap';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
  render(){
    return (
          <Router>
            <p>
              <section className = "Welcome-text">
                <h1><strong>Hey, I'm Noah Salda√±a</strong></h1>
                <section className = "Welcome-sub">
                  <p>iOS Developer - Student Mentor - Human-Centered Designer</p>
                </section>
                <section className = "Nav">
                  <Link to="/public">Projects</Link>
                  <Link to="/protected">About Me</Link>
                </section>
              </section>
            </p>
            <Switch>
              <Route path="/projects">
                <ProjectsPage />
              </Route>
              <Route path="/protected">
                <ProtectedPage />
              </Route>
            </Switch>
        </Router>
    );
  }
}
export default App;

function PublicPage() {
  return <div className="App">
  <header className="App-header">
    {/* <div className = "Profile-image">
          <img src={"https://noahsaldanadesign.com/img/IMG_3958.jpg"} alt={"https://noahsaldanadesign.com/img/IMG_3958.jpg"}/>
        </div> */}
    <section id = "Pictures">

      {entries.map((entry)=>(
        <Pictures
        key = {entry.name}
        name = {entry.name}
        link = {entry.link}
        description = {entry.description}
        />
      ))}
    </section>
  </header>
  </div>;
}

function ProtectedPage() {
  return <div>

  </div>
}
